Build ID: M20060921-0945

Steps To Reproduce:
With the idea of creating a tree with one parent node and a list of children, set the input of a TreeViewer to a data object with children.  The getElements(Object input) method then simply returns a new Object[]{ input }.  The parent item will appear in the tree with an expand icon, but when expanded, the list of children will consist of the parent item itself.

More information:
The conditional on line 1143 of AbstractTreeViewer causes the parent element to always return itself instead of its children.  
if (equals(parent, getRoot())) {
    return super.getRawChildren(parent);
}
getChildren will never be called.

Given the code:

  ArrayList<T> list = new ArrayList<T>();
  for (item : list) {  // error
  }

There is an error on "item", as it is undeclared.  Quickfix asks if you want to create a class, interface or enum for "item", or add a type parameter "item" to the class.  I would expect a suggestion of declaring an iterator variable "T item".  (Also the compiler is confused because it says on "list" that "Cannot convert element type T to item", so it thinks item is a type.)

This looks like a trivial content-assist but saves a lot of typing when iterating through complex generic containers-inside-containers.

- Run the following snippet on GTK
- Type 1 to overwrite the selected xx
- See the word "BOGUS" in the Console.
  If you run this on any other platform, "BOGUS" is not printed.

import org.eclipse.swt.*;
import org.eclipse.swt.widgets.*;
import org.eclipse.swt.layout.*;
import org.eclipse.swt.events.*;

public class TextVerifyTest {
	static Shell shell;
	static Text text;
	static boolean ignore = false;

	public static void main(String[] args) {
		Display display = new Display();
		shell = new Shell(display);
		shell.setLayout(new GridLayout());
		shell.setText("Single-Line Text Test");

		text = new Text(shell, SWT.SINGLE);
		text.setLayoutData(new GridData(GridData.FILL_HORIZONTAL));
		text.setText("xx < type here");
		text.setSelection(0, 2);

		text.addVerifyListener(new VerifyListener() {
			public void verifyText(VerifyEvent e) {
				System.out.println(
						"\nVerify, e.text=" + e.text +
						" e.start=" + e.start +
						" e.end=" + e.end +
						" ignore=" + ignore +
						(e.start == e.end && ignore == false ? " (BOGUS)" : ""));
				if (ignore) return;
				ignore = true;
				text.insert("yy");
				ignore = false;
				text.setSelection(0, 2);
				e.doit = false;
			}
		});

		shell.pack();
		shell.open();
		while (!shell.isDisposed()) {
			if (!display.readAndDispatch()) display.sleep();
		}
	}
}

